import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { Utente } from 'src/app/model/utente/utente';
import { UtenteService } from 'src/app/services/utente-Service/utente.service';

@Component({
  selector: 'app-rimuovi-utente',
  templateUrl: './rimuovi-utente.component.html',
  styleUrls: ['./rimuovi-utente.component.css']
})
export class RimuoviUtenteComponent implements OnInit{
  utente?: Utente = new Utente();
  private id = 0;

  constructor(private route: ActivatedRoute, private service: UtenteService,
              private router: Router) {}

  ngOnInit(): void {
    this.id = this.route.snapshot.params['id'];

    this.service
      .deleteUtenteById(this.id)
      .subscribe(
        {
          next: data => {
                    console.log('Utente eliminato con successo.');
                    this.router.navigate
                },
          error: error => console.log(error)
        }
      );
  }
}
